        <div className='error-message'>
          <p>Oops! Try again.</p>
          <span>The Pokemon you're looking for is a unicorn. It doesn't exist in this list.</span>
          <img src={pikachu} alt='pikachu'></img>  
        </div>
    );
}

export default ErrorMessage;
